import { AppProvider, Page } from "@shopify/polaris";
import "@shopify/polaris/build/esm/styles.css";
import Navbar from "./Components/Navbar";
import Configure from "./Components/Configure";
function App() {
  return (
    <AppProvider>
      <Page >
        <Navbar />
        <Configure/>
      </Page>
    </AppProvider>
  );
}
export default App;
